import React from 'react';
import { Card, Button } from 'react-bootstrap';

const Team = (props) => {
    const { strAlternate, strCountry, intFormedYear, strTeamBadge } = props.teams;
    const styleTeam = {
        border: '2px solid red',
        margin: '10px',
        borderRadius: '20px'

    }
    return (

        <div style={styleTeam} className="col-md-3 my-3">

            <Card style={{ width: '18rem' }}>

            <img style={{width:'200px'}} src={strTeamBadge} alt=""/>
            <h1></h1>
            <h12>Country:{strCountry}</h12>
            <h3>Year:{intFormedYear}</h3>

                <Card.Body>
                    <Card.Title>Name:{strAlternate}</Card.Title>
                    <Card.Subtitle className="mb-2 text-muted">Card Subtitle</Card.Subtitle>
                    <Card.Text>
                        Some quick example text to build on the card title and make up the bulk of
                        the card's content.
    </Card.Text>
                    <Card.Link href="#">Card Link</Card.Link>
                    <Card.Link href="#">Another Link</Card.Link>
                </Card.Body>
            </Card>

        </div>
    );
};

export default Team;
